import { BrowserRouter as Routes, Switch, Route, Link } from "react-router-dom";
import React from "react";
import Gpt from "./components/Gpt";
import Clock from "./components/Clock";
import "./css/main.css";
const App = () => {
  return (
    <Routes>
      <Route path="/">
        <div>
          <h1>AMG</h1>
          <Clock />
          <Gpt />
        </div>
      </Route>
    </Routes>
  );
};

export default App;
